import Subtitle from '../../shared/components/Subtitle';



export interface IDetailsListItem {
    key: number;
    value: number;
    name:string;
  }
const Contact =()=>{
  
  const [t, i18n] = useTranslation();


  const headerStyle = {
    cellTitle: {
      color: "#1A1F71",
      background: '#F4F2FF',
      border: '8px'
    }
  }
    const columns = [       
